import './Contact.scss'

export const Contact = ({ title }) => {
    return (
        <div className='Contacts'>
            <div className='Contact'>
                <h2 className='w'>Contact With Me</h2>
                <input className='Name' type='text'name='Name' value='Name'></input>
            </div>

            { title }
        </div>
    )
}
